                      Уважаемые  мои земляки!
Сегодня, когда каждый из Вас решает, за кого же из четырех претендентов отдать свои голоса, я предлагаю оценить кандидатов за преданность к людям и земле, на которой родился и живет, за  желание сделать свое село лучше, красивее и комфортнее для жизни, особенно для детей и молодежи, желание и способность  честно и ответственно работать для людей.
 Я  уверена, что  пришло время изменить все к лучшему.
 Я ответственно заверяю, что оправдаю  Ваши надежды, наведу порядок, информация о проделанной работе поселкового совета будет доступна каждому, населенные пункты будут Вас радовать чистотой. Для выполнения поставленных задач будут привлечены инвестиции.

   Программа, которую я выполню:
  Газификация;
  Ответственная работа милиции;
  Внедрение новых энергосберегающих технологий;
  Современные зоны для отдыха и спорта;
  Развитие туристической инфраструктуры;
  Социальные программы для инвалидов, пожилых людей ;
  Чистые территории населенных пунктов;
  Открытая и доступная информация о решениях и работе   
    исполкома;
  Культурно-оздоровительная деятельность;
  Вежливое отношение к людям.

    Достичь этих  целей мы сможем только вместе!
    Давайте сделаем так, чтобы  наши населенные пункты  превратились в зоны комфортной жизни для нас, наших детей и внуков, и мы гордились, что здесь живем!

response.about:
Наш клуб единственное место, объединяющее в себе музыку всех направлений - идеально подходит для веселых вечеринок или корпоративных праздников и фуршетов, романтического свидания или новых знакомств, счастливого безделья или позднего ужина.

Благодаря современному техническому оснащению клуба, здесь проводятся как закрытые тематические вечеринки, так и масштабные рейвы; концерты всемирно-известных групп и исполнителей, и общероссийские чемпионаты по компьютерным играм; прямые трансляции спортивных событий, проходящих по всему миру, и корпоративные мероприятия крупнейших холдингов региона.

Удобная парковка, вежливая охрана, внимательный персонал - приятные мелочи, которые добавят поводов Вашему хорошему настроению на весь вечер и всю ночь. Сюда приходят прежде всего танцевать, а не потому, что «здесь нужно быть» или показать свой социальный статус, в этом смысле наш клуб - место сугубо демократичное, касается это и стоимости входа, и цен в барах, и состава публики. Клуб посещает разнообразная, в основном молодежная позитивно-настроенная аудитория, в возрасте от 18 до 35 лет.

Политика клуба - как можно больше развлечений под одной крышей.

* уютный двух-уровневый верхний танцпол с мягким освещением и отдельными ложами с кожанными диванами;

* самый большой в городе трехуровневый нижний танцпол на 2000 человек с невероятным колличеством световых эффектов, оснащённый мощной 50кВт'ной акустической системой испанской фирмы D.A.S.; с отдельным баром и бархатными диванчиками в V.I.P.-зоне;

* заказать классический репертуар бара или попробовать незнакомые экзотичекие коктейли можно как не отрываясь от музыки (свой бар есть на каждом танцполе, и отдельный бар в V.I.P.-зоне), так и общаясь в тихой обстановке среднего бара;

* для любителей зелёного сукна - бильярд;

* кальян: для кого-то это экзотика, для тех, кто уже попробовал и разобрался, это возможность расслабиться и отдохнуть, насладиться ароматом кальянного табака и просто хорошо провести время.

ВНИМАНИЕ! Посещая клуб "Матрица", Вы должны быть готовы оказаться в пространстве без ограничения на удовольствия и развлечения!
